function AboutMe() {
    return (
        <section className="about">
            <h2 className="about__title">Студент</h2>
            <div className="about__info">
                <div className="about__description">
                    <p className="about__name">Дмитрий</p>
                </div>
            </div>
        </section>
    )
}

export default AboutMe;
